description:
{'en': 'Exquisite chinese desserts. Wide range of selection: cold or hot, with durian, with ice-cream etc. Prices also premium.

Service was quick and helpful. Lots of guidance for first-time customers: paper menu, pen write order, pass to cashier (no paywave), collect by pager.

Place was clean and very nice (touristy).'}

{'en': "I went there at past 6pm on a Sunday and there were no long queues. I got seated right away and ordered Mango Sago. My order came right away in less than 5mins.
Staff don't speak English that much but it will be easy to order. They give you the menu and a piece of paper and pencil and that's where you right your orders. Then you go to the cashier to submit your order and pay right away.

It's a must try üëåüèª"}

{'en': 'Traditional desserts that you cant easily find in singapore. I one i would recommend is the egg pudding. It seems that the warm one would taste much better than the cold one.

I also like Durian seaweed green bean soup. Although it sound weird but it is definitely a good choice and taste wonders.

You can add ice cream to different kind of desserts. It might surprised you on how good it would taste.'}

{'en': 'üìç@ahchewdesserts, Singapore üá∏üá¨

We had the best time having dinner and desserts on our second night in Singapore ü•∞

Second stop was Ah Chew Desserts to try some Chinese-style dessert soups and puddings - absolutely loved their peanut mochi ü§§'}

{'en': "Traditional dessert shop that brings back childhood memories.

From peanut soup, to tarp, to black glutinous rice to mango sago, there are literally over 30 choices on their menus (yep, I didn't count).

If you enjoy ice cream, highly recommend you add a scoop to the dessert. Makes it just that much sweeter."}

{'en': 'Great place for traditional Chinese dessert. Ordered Yam Paste, papaya milk and ginko barley with rice balls.

Really recommend the yam paste. It not diluted and able to taste the yam. Not overly sweet.

Service is quick and there are ample seats. Can get rather crowded in the evening but the turnover is quite fast.'}

{'en': 'Amazing dessert spot, once we saw the line we knew it was legit. CASH only.

The staff will let you browse and order, followed by 30 mins to consume your dishes. Absolutely understandable, lots of hungry dessert seekers waiting!

Ordered the durian mango sago with pomelo, gluttonous black rice with ice cream, and mochi. Many items were sold out, which makes me want to try them even more (particularly the HK style dishes). Can‚Äôt wait for next time!'}

{'en': 'Repeated visits over the years! Their lunch deals are a bang for buck but dinner vibes are so on point too.

The noodles never disappoint, generous portions and dumpling always fried/cooked to perfection. The pierogi dumplings is an easy favourite, with the sriracha crema dressing before the perfect cherry on top. Dont give their dessert dumplings a miss - the poached pears fried dumps reminds me of apple pie, and their vanilla ice cream is rich and aromatic, with visible vanilla pods.

Reservations are recommended in advance, as they have limited seating'}

{'en': 'ü•ü The sharing set comes amazing dumplings with unique flavours (Duck, Mentaiko sauce, Curry powder, Mayo, Soy sauce).

üçù The noodles are well done and seasoned well. The fried onions gives it a good crunch.

The service was amazing. Props to the staff who accommodated us well even though we were walk ins during the busy evening dinner time. He was able to get us a table after telling us to wait for a while üòä'}

{'en': 'Visited twice in two weeks because I enjoyed the food and ambience so much.

For two people, we ordered pickled bean sprouts, pickled black fungus, dumpling platter of 15, miso mushroom noodles, longan osmanthu pu-erh, and bottomless artisanal hot tea, all of which served promptly by the attentive staff, who also accommodated my seat-related request.

Definitely recommend making a reservation, and noting the time limit of 1 hour for dinner.'}

{'en': 'Absolutely loved the food here, dumplings are out of this world! ü•üüí•

If you can handle spicy, do try the Sichuan spicy ones. Noodles are pretty tasty too, I went for the braised pork noodles. For drinks I had the wolfberry puerh one, which was very refreshing and unique.

This place is a must try for their dumplings, do book your table in advance as this place is very popular!'}

{'en': 'Came here for dinner with friends on a Friday night. We love the dumplings and the drinks. Although there were many customers service was prompt and staff were friendly.

For me the food really gave me comfort to end the work week. The prices were also reasonable the side dish was also very tasty and not salty.

Overall it was a pleasant experience and will visit again for their dumplings.'}

{'en': 'Love the dumpling and service crew are attentive. Even though they look young but I am impressed with their service and with a smile. Keep up the good work.

Worth trying the set lunch and you get to try almost their full food menu.

But do note that is a small outlet, good to make reservation before hand if you are coming after 1130am.'}

{'en': 'Nice concept and great food flavour. The lunch set is $16+ which is quite alright for the quality of food and drinks. I had the sour plum pu er drink which was very well done.

The fried truffle potato dumplings was a new and interesting twist. I liked the braised pork noodles which is quite light since they use pulled pork (instead of pork belly) and sauce over the noodles.

Came here using the 1 for 1 burpple beyond promo.'}

{'en': "Came here for a quick lunch by myself, and thought it was pretty easy breezy to navigate around their lunch menu. Just enough choices and not too much to overwhelm you.

It was a pretty yummy meal if you're around the CBD and are craving for some good old egg noodles with dumplings, in a nicer setting than your hawker/food court. I also loved the drink and thought it complemented the savoury noodle and dumplings. Portions were good as well! I definitely left feeling happy and satisfied.

Service was friendly and overall, the vibe was great. Personally, I think it is value for money and will come back again!"}

{'en': 'Visited on a weekend evening, reserved in advance.

From someone who loves dumplings, these were really excellent - texture of pan-fried dumplings was just right, fusion flavours including the smoked duck and pierogi were exciting yet well-balanced and really delicious. Loved all 5 types that came in the sampler, and we tried the dessert dumplings with honey ice cream as well. There was an interesting cocktail range too.

Will definitely return for more. üëç'}

{'en': "When you arrive at Dumpling Darling and it's pretty crowded, make sure you go to the tablet and register yourself to join the queue. The servers will call you when your table is available. While you wait, grab an order sheet and menu to decide what you are going to eat.

If you are here during lunch time, get the affordable lunch set that costs around $16. You get dumplings and a bowl of noodles. I had the mushroom noodles and this was delicious. The texture of it is unlike any noodle I have tried before.

While you wait for your food, there is also a free vegetable starter served."}

{'en': "Nice and cozy restaurant with friendly staff.

People probably will visit for the dumplings, they are great to be sure. First timers should definitely go for their platter to try all 5 types of dumplings available.

The original gyozas are good. The pierogi are great, my personal favourite of the five with a beautifully crisp texture. But the pear and cheese dumpling dessert? Amazing. I think I'll drag a couple of friends back just for the dessert."}

{'en': 'great service from the crew and food to match as well. very reasonable prices for the quality of food. had a counter seat and observed the bartender had a lot of pride in his work.

great sample of different types of dumplings with good flavours. should give it a try.

keep up the good work team.'}

{'en': 'The atmosphere at this outlet is different than the one at Circular Road. It feels like a hidden restaurant tuck away with delivery food.

The staff were nice and helpful. I was waiting for my friend, so I asked if I could be seated and order first, and they showed me to a table.

The dumplings and Miso Mushroom Noodles were really flavourful.'}

{'en': 'Went on a crowded Sunday noon, only had outdoor seating then. Would advise others to make a reservation ahead of time!

Got 1 set lunch (noodles, dumplings, drink) and an ala carte noodles and it was a lot of food for 2 of us. Saw reviews that raved about the Fried Pierogi dumplings and they were indeed very savory and delicious! The Miso Mushroom Noodles and Braised Pork Noodles were definitely not the stars of the show, but they are very affordable for the portion  (7.50++)

They also served a free serving of bean sprouts with carrots before anything was served, which was a great appetizer.'}

{'en': 'My 5th time back here and i got to admit that they never fail deliver amazing dumplings and noodles.

My go-to is their Miso mushroom noodles with smoked duck dumplings or fried pierogi!

Recommended and brought my close friends here and they all love it!!'}

{'en': 'loveddd the truffle, duck, and original dumplings!! super unique and different takes on the usual, traditional dumpling. i enjoyed it a lot!
i also tried the miso mushroom noodles, but honestly it was quite meh, could use more sauce.

anyways, the staff were super friendly and warm, they were really attentive to our needs!üòäü•üwould definitely come back again for their dumplings.'}

{'en': 'This place deserves a 5-star rating due to the friendly yet attentive service - something that 90% of eateries in Singapore virtually have none of.

My date and I ordered the Dumpling Party which is essentially the sampler platter of all dumplings minus the spicy one. The dumplings were succulent and crispy.

We had great times there and we‚Äôll come back for the noodles (and the service). I know you guys are getting all the attentions and are doing extremely well but please stay the same! <3'}

{'en': "Probably the best dumpling I've ever had in SG! My fav is the pierogi and tried the smoked duck and it was really good too. The ala carte dumplings came in 5pcs. The noodles have firm texture which I like and flavour-wise is also good.

The place is quite small so expect queue during peak hrs. Price-wise is reasonable for eateries at the area.

Bonus: they have really cute menu!"}

{'en': 'We had brunch at Dough on a weekday morning and it was a quiet start to the day. The staff was friendly and welcoming.

I had the dragonfruit hummus toast and thought the combination was interesting. You taste the saltiness of the hummus and then the sweetness from the dragonfruit. My friend had the bacon & egg french toast. It was served on a slice of soft charcoal toast, drizzled with peanut butter and maple syrup - salty and sweet yum. We also ordered the mentaiko tater tots which I thought was a little lacklustre.

But overall, food was good and to top it off, the coffee was great so I‚Äôll definitely come back again.'}

{'en': 'One of the best places to have authentic good quality Mexican food at an affordable price.

There was a short queue on a rainy Sunday afternoon around 1230pm, probably waited around 20mins to enter. There‚Äôs 2 floors and a decent amount of space. The furnitures has a no frills vibe, ordering is also simple through the staff. We got ourselves some of the popular items as indicated on the menu which is perfect to share for 2 pax.

The tacos took awhile to come and was come piping hot. While the loaded nachos had some great flavors and textures, I felt the tacos was abit too heavy for my liking. Total bill came up to $62.'}

{'en': 'I was so excited to see a somewhat authentic looking mexican place in Singapore, and it did not disappoint. Definitely need a reservation for this place.

We ordered the mega loaded nachos, fish tacos, and an horchata. The portions were great and the price to quality ratio was excellent. The loaded nachos were definitely intended as a meal to be shared with 2-3 people but if you‚Äôre ambitious you can try eating it as your main. The pickled onions they put on the nachos were super flavorful and the generous portion of guacamole tasted super fresh. Fish tacos had the best chipotle sauce I‚Äôve had in a long long time, though some extra cabbage would‚Äôve been nice for balance. Horchata needed to be strained- it was super chalky, but the flavor was excellent.

Overall was super pleased and satisfied with the meal we had here for lunch, and if the occasion rises again, would definitely be back to fulfill the mexican food craving.'}

{'en': 'The queue was 45 minutes on a Saturday evening ‚Äî but I totally understand why. Boyfriend and I ordered the loaded nachos ($20), mushroom tostado ($9), carnitas pork tacos ($12), and baja fish tacos ($14). We were amazing by the generous amount of toppings, especially for the nachos ‚Äî they didn‚Äôt skimp on anything, from the chicken and cheese to the avocados and cream cheese. The tacos were also surprisingly filling and extremely flavourful!

We also got the agua fresca (fresh watermelon and mint, $6), which was pretty standard, and the horchata (cinnamon rice milk, $7), which we really enjoyed because of how smooth it was.

I would recommend visiting off-peak or go in small groups if you don‚Äôt want to wait for a seat. Boyfriend and I managed to jump the line and be seated before the 3 groups ahead of us because there was an empty table for 2!'}

{'en': "Food here is 10/10 whenever I visit and friends I've brought here to eat have all given their stamp of approval. It's the kind of place you wish to gatekeep because of the long queue but somehow everyone already knows about it.

Recommended to come as groups 3-4 pax so that you can share and try more food! The tendency to overorder here is real because the menu looks enticing and most dishes taste good. Not recommended to come in groups bigger than 4 pax as there are limited seats and no big tables.

Must order: loaded nachos, cauli bites, onion petals, birria beef quesadillas"}

{'en': "Best Mexican I've had in Singapore (but the bar is low).

Expect a wait if you go during peak hours but they seemed to turn over tables relatively quickly. Food is not too expensive and portion sizes are big.

The pork Al pastor burrito is the best. Loaded nachos also good, and had flavorful guacamole. Fish tacos are fried nicely. The churros are BOMB and not too sweet"}

{'en': 'The food is absolutely to DIE for! Loved the loaded nachos, pork quesadilla, and the churros with dark chocolate ganache. The churros were the highlight of the meal for sure.

Portions are huge. We ended up taking two boxes home after ordering nachos for the table and one main each.

Just ensure you book well in advance, because it‚Äôs a small place that‚Äôs super popular, and slots fill up quick. We went on a Wednesday, and still had to wait an hour to get seated.'}

{'en': 'This mexican joint lives up to its hype & queue! Arrived at 6pm on a Saturday and we had 3 parties ahead of us and many joining after us.

Baja Fish Tacos ($17 for 3) was so yummy! Fish was crispy and well fried, balanced purple cabbage toppings and the spicy sauce was so good. My friend had the Chipotle Chicken Quesadilla ($16) and the meat was dripping with juices. Churros ($9.90) came freshly fried and warm! & the chocolate ganache was thick, likely high quality dark choc.

Will definitely be back in the near future to try out their burritos and nachos! Probably aim reach a little before opening at 5pm to avoid the queue.'}

{'en': 'nice mexican food place! it can get quite busy so do make a reservation if you plan to head over!

i highly recommend the loaded nachos ü§© and if you like spicy stuff, try the fish tacos! the loaded nachos were packed with guacamole and meat. üëçüèªüëçüèª

only comment is that the attentiveness and speed of the wait staff could be improved. i think hiring more workers would be another way of solving this, it was mostly one waiter just rushing all over the place.'}

{'en': 'Probably one of the best Mexican food places in SG.
Loved the loaded nachos that came witih chicken, loads of guacamole, cheese

Will go back for more'}

{'en': "Great place to grab some mexican food. 2 of us got their 4 tacos and a sharing bowl of nachos to share.

This place doesn't over do its mexican food and that what i like. It's your classic ingredients of grilled chicken, lime and a decent taco skin. Guca is done well too. The price isn't abusd either. In total it cost about $50 for a very fillling lunch.

One downside i guess is that seating in this place is very limited, like max capacity 20 sort of limited. Even for lunch on a weekday, it was quite packed, so i would reccommend takeaways if possible."}

