{'en': 'We started queueing at 530 but missed the first seating. Staff took our name promptly and asked us to come back around 7 for second seating. It was a pretty accurate estimate.

The pastas and mussels that we ordered were tasty. I‚Äôm still thinking about that spicy rigatoni! Strongly recommend. They offered us extra bread to mop up the gravy but unfortunately our pastas didn‚Äôt have much gravy. Wines were affordable. The only letdown was the cannoli. At $8, it‚Äôs a good size for sharing but I would not recommend it. Shell was hard, filling didn‚Äôt particularly stand out either.

Staff were efficient and friendly especially front of house(? Would be great if they eventually take reservations but I would still return to try other items. I think they do take feedback seriously and are improving.'}

{'en': "Some people say this place is overrated, but for me, waiting an hour in line was absolutely worth it. Our favorite dish turned out to be the beef steak from their special menu, perfectly seasoned, crispy on the outside, and tender and juicy on the inside.

Over two visits, we tried six different pasta dishes, and each one stood out with its own unique flavor. Every plate was thoughtfully prepared and delicious.

If you're looking for a fine-dining atmosphere, this might not be the spot for you. The one hour dining limit and high chairs make for a more casual experience. But if you‚Äôre after authentic, high quality pasta at a reasonable price, this place is a must visit. I‚Äôll definitely be coming back!"}
